import './Friends.css';

const Friends = () => {
    const [friends,setFriends]=useState();
    useEffect(async ()=>{
       await axios.get('${server}/getallusers').then(
            (res)=>{
                if(res.data.status){
                    setFriends(res.data.users);
                }
                
            }
        ).catch((error)=>{

        })
    })
  return (
    <>
        <Header/>
        <div className='friend-container'>

        </div>
    </>
  )
}

export default Friends;
